import{_ as e,o,c as t,N as c}from"./chunks/framework.60272d8a.js";const g=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"guide/vue/vue线上环境开启vue-devtools.md","lastUpdated":1706686109000}'),s={name:"guide/vue/vue线上环境开启vue-devtools.md"},a=c('<h2 id="vue-线上环境-开启-vue-devtools-转载" tabindex="-1">vue 线上环境 开启 vue-devtools（转载） <a class="header-anchor" href="#vue-线上环境-开启-vue-devtools-转载" aria-label="Permalink to &quot;vue 线上环境 开启 vue-devtools（转载）&quot;">​</a></h2><p><img src="https://csdnimg.cn/release/blogv2/dist/pc/img/original.png" alt=""></p><p>vue 项目打包正式环境时，是没有 vue-devtools 选项卡的，没法看 vue 内部的数据</p><p><img src="https://img-blog.csdnimg.cn/20201207105715883.png#pic_center" alt="在这里插入图片描述"></p><p>使用以下几步可以实现在不改代码的情况下开启 vue-devtools</p><ol><li>选中 Source 选项卡，找到打包好的 app.js，并格式化</li></ol><p><img src="https://img-blog.csdnimg.cn/20201207105835927.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3dlaXhpbl80NDcxNzQ3Mw==,size_16,color_FFFFFF,t_70#pic_center" alt="在这里插入图片描述"></p><ol start="2"><li>ctrl + f 搜索<code>$mount</code>或者<code>render</code>或者<code>mount</code>并在<code>new</code>那里打断点，<code>new</code>后面的对象就是 Vue 对象，需要记住该变量名，下一步要用到</li></ol><p><img src="https://img-blog.csdnimg.cn/20201207105847981.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3dlaXhpbl80NDcxNzQ3Mw==,size_16,color_FFFFFF,t_70#pic_center" alt="在这里插入图片描述"></p><ol start="3"><li>F5 刷新页面就就会进入断点，并在控制台输入<code>d[&quot;default&quot;].config.devtools = true</code>（<code>.config</code>之前的对象就是上一步<code>new</code>后面的对象）</li></ol><p><img src="https://img-blog.csdnimg.cn/20201207105858626.png#pic_center" alt="在这里插入图片描述"></p><ol start="4"><li>F8 结束断点，关闭控制台，再次打开控制台就可以看到 vue-devtools 了</li></ol><p><img src="https://img-blog.csdnimg.cn/20201207105909422.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3dlaXhpbl80NDcxNzQ3Mw==,size_16,color_FFFFFF,t_70#pic_center" alt="在这里插入图片描述"></p>',13),l=[a];function d(i,p,n,r,_,m){return o(),t("div",null,l)}const v=e(s,[["render",d]]);export{g as __pageData,v as default};
